import React, { useState } from "react";

const SowingForm = () => {
  const [farmerId, setFarmerId] = useState("Orma_00001");
  const [landId, setLandId] = useState("Orma_00001-1");
  const [crop, setCrop] = useState("Tomatoes");
  const [sowingDate, setSowingDate] = useState("2024-08-01");
  const [sownQuantity, setSownQuantity] = useState(500);

  const handleSubmit = (e) => {
    e.preventDefault();
    const formData = {
      farmerId,
      landId,
      crop,
      sowingDate,
      sownQuantity,
    };
    console.log("Form Data Submitted: ", formData);
    // Here you can send the form data to an API or handle it as needed.
  };

  const handleEdit = () => {
    console.log("Edit button clicked");
    // Implement edit functionality here.
  };

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh", // Full height of the viewport
        backgroundColor: "#f5f5f5", // Light background color to make the form stand out
      }}
    >
      <div
        style={{
          border: "1px solid brown",
          padding: "20px",
          borderRadius: "10px",
          width: "300px",
          backgroundColor: "#fff", // White background for the form
          boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)", // Add a subtle shadow
        }}
      >
        <form onSubmit={handleSubmit}>
          <div>
            <label>Farmer id:</label>
            <select value={farmerId} onChange={(e) => setFarmerId(e.target.value)}>
              <option value="Orma_00001">Orma_00001</option>
              <option value="Orma_00002">Orma_00002</option>
              {/* Add more Farmer IDs as needed */}
            </select>
          </div>

          <div>
            <label>Land id:</label>
            <select value={landId} onChange={(e) => setLandId(e.target.value)}>
              <option value="Orma_00001-1">Orma_00001-1</option>
              <option value="Orma_00001-2">Orma_00001-2</option>
              {/* Add more Land IDs as needed */}
            </select>
          </div>

          <div>
            <label>Crop:</label>
            <select value={crop} onChange={(e) => setCrop(e.target.value)}>
              <option value="Tomatoes">Tomatoes</option>
              <option value="Corn">Corn</option>
              <option value="Wheat">Wheat</option>
              {/* Add more Crops as needed */}
            </select>
          </div>

          <div>
            <label>Sowing Dt.:</label>
            <input
              type="date"
              value={sowingDate}
              onChange={(e) => setSowingDate(e.target.value)}
            />
          </div>

          <div>
            <label>Sown Quantity:</label>
            <input
              type="number"
              value={sownQuantity}
              onChange={(e) => setSownQuantity(e.target.value)}
            />
          </div>

          <div style={{ marginTop: "10px" }}>
            <button type="button" onClick={handleEdit}>
              Edit
            </button>
            <button type="submit" style={{ marginLeft: "10px" }}>
              Submit
            </button>
            <button type="button" style={{ marginLeft: "10px" }}>
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default SowingForm;
